import React from "react";
import "./Hero.css";
const Hero = () => {
  return (
    <main>
      <div className="hero_sec">
        <div>
          <p>Buy used cars.</p>
        </div>
        <div>Sell your car</div>
      </div>
    </main>
  );
};

export default Hero;
